import Navbar from './navbar';
import Head from 'next/head';
//const Img = require('../public/images/justin-eisner-140955-unsplash.jpg');

const Layout = (props) => (
    <div>
        <Head>
            <meta name="viewport" content="width=device-width, initial-scale=1, shrink-to-fit=no"></meta>
            <title>Wyvern Realty Group</title>
            <link rel="stylesheet" href="https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css" integrity="sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T" crossOrigin="anonymous"></link>
        </Head>
        <Navbar />
        <div className="bg-image">
            <style jsx>{`
                .bg-image {
                    position: absolute;
                    background: url('https://images.unsplash.com/photo-1474696100102-01b8519f06f3?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1650&q=80');
                    width: 100%;
                    height: 100%;
                }
            `}</style>
        </div>
        <div className="container">
            {props.children}
        </div>
    </div>
)

export default Layout;
